import React from 'react';
import { TextInput, Button, Surface } from 'react-native-paper';
import { StyleSheet } from 'react-native';

export const Login = ({ navigation }) => {

    const [textEmail, setTextEmail] = React.useState('');
    const [textPassword, setTextPassword] = React.useState('');

    return (
        <Surface style={styles.surface}>
            <TextInput
                style={styles.input}
                label="Email"
                value={textEmail}
                onChangeText={textEmail => setTextEmail(text)}
            />

            <TextInput
                style={styles.input}
                label="Password"
                value={textPassword}
                onChangeText={textPassword => setTextPassword(text)}
            />

            <Button style={styles.button} mode="Flat" onPress={() => console.log('Pressed')}>
                Press me
            </Button>
        </Surface>
    )
}


const styles = StyleSheet.create({
  surface: {
    justifyContent: 'center',
    elevation: 4,
    flex: 1,
    padding: 20
  },
  input: {
      marginBottom: 10
  },
  button: {
      height: 60,
      marginTop: 10,
      justifyContent: 'center'
  }
});
